import React from "react";
import AuthService from "../services/auth.service";
import { Link, useHistory, useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import white from "../assets/white.jpg";
import "../components1/Profile.css"

let p = localStorage.getItem("username");
let j = localStorage.getItem("jwt");
const Profile = () => {
  const navigate = useNavigate();
  const logOut = () => {
    AuthService.logout();
    navigate("/");
  };
  const [user, setFaculty] = useState([]);
  const init = () => {
    AuthService.getUser(p)
      .then((response) => {
        console.log("Printing faculty data", response.data);
        setFaculty(response.data);
      })
      .catch((error) => {
        console.log("Something went wrong", error);
      });
  };
  useEffect(() => {
    init();
  }, []);
  return (
    <div
      className="profile"
      style={{
        background:
          "url(D:GNITEighth SemesterCapgeminiBUCode - Copysrcassetswhite.jpg)",
        height: "500px",
        marginLeft: "20px",
      }}
    >
      <div
        class="col-sm-3 sidenav hidden-xs"
        style={{          
         
          marginTop: "12%",
        }}
      >
        <header className="jumb" style={{ marginTop: "12%" }}>
          <h1
            style={{
              fontSize: "50px",
              fontFamily: "Monotype Corsiva",
            }}
          >
            Dashboard
          </h1>
          <h3
            style={{
              fontSize: "25px",
              // fontFamily: "Monotype Corsiva",
            }}
          >
            <strong>{user.username}</strong> Profile
          </h3>
        </header>
        {/* <p>
          <strong>Token:{j}</strong>
        </p> */}
        {/* <p>
          <strong>Id:</strong> {user.id}
        </p> */}
        <p
          style={{
            fontSize: "18px",
            marginTop: "20px",
          }}
        >
          <strong>Email:</strong> {user.emailId}
        </p>
        <p
          style={{
            fontSize: "18px",
          }}
        >
          <strong>Authorities: </strong>
          {user.roles}
        </p>

        <ul>
          <button
            className="btn btn-danger ml-2"
            style={{
              fontSize: "12px",
            }}
            onClick={() => {
              logOut();
            }}
          >
            LOGOUT
          </button>
        </ul>
      </div>
      {/* <button
        className="btn btn-danger ml-2"
        style={{
          marginRight: "20px",
        }}
        onClick={() => {
          logOut();
        }}
      >
        Add Booking
      </button> */}
    </div>
  );
};
export default Profile;
